{"reasoning":"The ground-truth bug is specifically about an NPC that remains in a T-pose/A-pose while moving – the legs do not animate, the character floats/slides up stairs and across the ground. The defining symptoms are: (1) character is locked in a reference pose, (2) no proper walking animation plays, (3) sliding/floating movement results.

The generated report only says the character’s movements are “stiff and robotic” and that the limbs move unnaturally while walking. It does not mention the character being fixed in a T-pose/A-pose, nor sliding/floating without leg animation. Instead, it implies that some (incorrect) limb animation still plays during normal walking. Therefore it describes a more general animation quality issue, not the specific T-pose sliding bug of the ground truth.

Because the key signature behavior (T-pose/A-pose with sliding) is absent, the two reports are about different underlying issues.","match":false}

{"reasoning":"Ground truth bug is that the helicopter is able to fly even though its rotor blades are completely motionless. The mention of a character "beneath" the helicopter is incidental; the key symptom is the missing rotor animation while the helicopter is airborne.

The generated report focuses on the character: the character is “hanging” or “suspended in mid-air” and is not interacting correctly with physics. It does not mention the rotor blades at all, nor does it describe the helicopter’s ability to stay aloft without spinning rotors. The core symptom it highlights (character’s physics) is different from the core symptom in the ground truth (helicopter flying with static rotors).

Because the primary issues described are different, the two reports do not refer to the same underlying bug.","match":false}

{"reasoning":"The ground truth bug concerns an NPC that is endlessly looping an animation as it tries to pick up a floating briefcase beside a red truck. The symptoms are an animation loop and a floating object (briefcase). 

The generated report instead talks about a vehicle trunk that shows as empty when opened, implying a rendering/visibility problem with the trunk’s contents. There is no mention of an NPC animation loop, a floating briefcase, or repetitive pickup attempts. Likewise, the ground-truth issue does not involve an empty trunk or invisible trunk contents.

Because the core behaviors, objects involved, and observed problems are different, the two reports do not refer to the same underlying bug.","match":false}

{"reasoning":"Ground truth focuses on a specific case: a plane sitting on the water suddenly catapults into the air and the fragments that appear do not correspond to the plane’s mesh. The key elements are (1) an aircraft resting on the water surface, (2) an explosion that launches the aircraft upward in an unrealistic way, and (3) debris whose shape is inconsistent with the plane geometry.

The generated report instead talks about an underwater torpedo explosion where debris and bubbles move or float unrealistically. It does not mention an aircraft, the water-surface launch, or geometry-mismatched fragments; it emphasizes particle physics (bubbles, debris motion) during an underwater detonation.

Because the scenarios (plane vs. underwater torpedo), the symptoms (air-launch and wrong mesh vs. erratic particle motion), and the afflicted assets differ, the two descriptions do not refer to the same underlying bug.","match":false}

{"reasoning":"The ground truth describes a problem where, during an animation, the truck rises off the ground, becomes partially airborne, and clips through parts of a building. The essential symptom is that the truck is hovering/floating instead of remaining on the ground.

The generated report likewise states that a delivery truck is “hovering above the ground without any visible support” and remains suspended for an extended period, calling it a physics glitch. Although it does not explicitly mention the clipping into the building or the preceding wall collision, the core malfunction (truck floating in mid-air instead of staying on the ground) is the same. No contradictory details are provided, and both refer to a truck vehicle anomaly caused by faulty physics/animation.

Therefore, they describe the same underlying bug.","match":true}

{"reasoning":"Ground truth describes a specific physics bug: after being hit by a rocket launcher, the jet fighter starts endlessly rotating around a pole. Key symptoms: hit by rocket, rotational motion around pole.

Generated report describes a different event: a jet crashes into a residential area, causing explosions and debris. No mention of rocket impact trigger, no rotation around a pole; instead it is about a crash and explosions affecting environment.

Because the core behavior, trigger, and symptoms differ, the two reports do not refer to the same underlying bug.","match":false}
